import React from "react";
import {FaCloudDownloadAlt} from 'react-icons/fa'


const Header = () => {
  return (
    <div className="header">
      <h3>Find Your Farm</h3>
      <img src={FaCloudDownloadAlt} />
    </div>
  );
};

export default Header;
